issue.body:
It is expected that a `KeyValueStore` will have multi-dimensional arrays set as the value for a key. To facilitate working with this kind of structure we should support accessing nested values from a single call to `KeyValueStore::get`. For example, if the following data was set in the store:

```
$values = [
    'foo' => [
        'bar' => [
            'baz' => 'foobarbaz'
        ],
     ]
];

$keyValueStore->set('something', $values);
$string = $keyValueStore->get('something.foo.bar.baz');    // foobarbaz
```
